from functools import cache
@cache
def Trow(n: int) -> list[int]:
    if n == 0:
        return [1]
    row = Trow(n - 1) + [1]
    for m in range(n - 1, 0, -1):
        row[m] = (n - m + 1) * row[m] + row[m - 1]
    row[0] *= n
    return row
